import Link from 'next/link';

const AboutUs = () => {
    return (  
        <div>
            <ul>
                <li><Link href="/"><a>Inicio</a></Link></li>
                <li><Link href="/aboutUs"><a>Sobre Nosotros</a></Link></li>
            </ul>
            <p>Sobre Nosotros</p>
        </div>
    );
}
 
export default AboutUs;
